import React from 'react';
import { BrowserRouter as Router, Route, Routes, Link } from 'react-router-dom';
import BarChart from './components/BarChart';
import LineChart from './components/LineChart';
import PieChart from './components/PieChart';
import RadarChart from './components/RadarChart';
import ScatterPlot from './components/ScatterPlot';

function App() {
  return (
    <Router>
      <div>
        <header>
          <h1>UMD Climate Data</h1>
          <nav>
            <ul style={{ display: 'flex', listStyle: 'none', gap: '1rem' }}>
              <li><Link to="/bar">Bar Chart</Link></li>
              <li><Link to="/line">Line Chart</Link></li>
              <li><Link to="/pie">Pie Chart</Link></li>
              <li><Link to="/radar">Radar Chart</Link></li>
              <li><Link to="/scatter">Scatter Plot</Link></li>
            </ul>
          </nav>
        </header>
        <main style={{ margin: '2rem 0' }}>
          <Routes>
            <Route path="/bar" element={<BarChart />} />
            <Route path="/line" element={<LineChart />} />
            <Route path="/pie" element={<PieChart />} />
            <Route path="/radar" element={<RadarChart />} />
            <Route path="/scatter" element={<ScatterPlot />} />
            <Route path="/" element={
              <div>
                <h2>Welcome!</h2>
                <p>Select a visualization to learn more.</p>
              </div>
            } />
          </Routes>
        </main>
      </div>
    </Router>
  );
}

export default App;
